import React from "react";
import Header from "./components/header";
import ContactContent from "./components/contact";
import Footer from "./components/footer";
function Contact() {
  return (
    <div>
      <Header />
      <ContactContent />
      <Footer />
    </div>
  );
}
export default Contact;
